description:
Tufts CTSI | Full-time | Remote, U.S. | Junior Research Software Engineer
Tufts CTSI (
https://www.tuftsctsi.org/
) is one of 60 NIH CTSA awardees. We are seeking a clinical data analyst / RSE to support our investigators with cohort discoveries, chart abstractions, data modeling, visualizations, and other data analysis needed for the preparation and performance of medical research grants. You would also help us grow our OHDSI (
https://ohdsi.org
) based research data warehouse (ETL from Epic EHR), work with RedCAP instruments, and automate operational processes. This role requires outstanding verbal and written literacy, a love of healthcare data, coupled with technical competence. We use Julia (esp.
https://github.com/MechanicalRabbit/FunSQL.jl
) for our database query work. This job is mostly researcher support and improving our ETLs; software we build/use is open source.
This job requires you reside in the U.S. without additional work permits. This is a junior position. This job advertisement is open but not yet posted. You could email me, hn-20240501@clarkevans.com to apply. Thank you so much.

Exnaton (Climate Tech) | Frontend Developer | Remote (EU countries) | fulltime
Exnaton is a start-up spun out of ETH Zurich, which offers software for renewable energy to utility companies. Our software enables energy providers to set up energy communities and smart energy tariffs in their distribution areas. Users of our software can track their energy consumption and buy renewable energy from their neighbors, which makes investing in the energy transition simple and fun!
Role requirements:
- degree in computer science, electrical engineering, statistics, mathematics, physics, engineering, or relevant experience;
- a minimum of 3 years of industry experience in frontend development; 
- experience with one of the modern JavaScript frontend frameworks and an understanding of core concepts, such as “component boundaries”, “state management”, and experience with data visualisation;
- experience in creating and contributing to UX-focused designs and design systems with themability;
- knowledge of JavaScript/TypeScript and knowledge of state-of-the-art frameworks like React;
- experience shipping SaaS web applications with well-abstracted components, composability and customizability;
- motivation to  constantly and consistently learn new skills, make quick decisions, and clearly prioritize what moves the needle;
- motivation to work in a climate tech company.
More information here:
https://exnaton-ag.jobs.personio.com/job/1742376?language=en...
